import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { motion } from 'framer-motion';

// Components
import Navigation from './components/Navigation/Navigation';
import LandingPage from './pages/LandingPage/LandingPage';
import Login from './pages/Auth/Login';
import Register from './pages/Auth/Register';
import PatientDashboard from './pages/Patient/Dashboard/PatientDashboard';
import PractitionerDashboard from './pages/Practitioner/Dashboard/PractitionerDashboard';
import PatientSchedule from './pages/Patient/Schedule/PatientSchedule';
import PatientProfile from './pages/Patient/Profile/PatientProfile';
import PractitionerSchedule from './pages/Practitioner/Schedule/PractitionerSchedule';
import PractitionerPatients from './pages/Practitioner/Patients/PractitionerPatients';
import BookingSystem from './pages/Booking/BookingSystem';
import NotificationCenter from './pages/Notifications/NotificationCenter';
import PrivateRoute from './components/PrivateRoute/PrivateRoute';
import { AuthProvider } from './contexts/AuthContext';
import { NotificationProvider } from './contexts/NotificationContext';

// Page transition variants
const pageVariants = {
  initial: {
    opacity: 0,
    y: 20
  },
  animate: {
    opacity: 1,
    y: 0,
    transition: {
      duration: 0.3,
      ease: "easeOut"
    }
  },
  exit: {
    opacity: 0,
    y: -20,
    transition: {
      duration: 0.2,
      ease: "easeIn"
    }
  }
};

function App() {
  return (
    <AuthProvider>
      <NotificationProvider>
        <Router>
          <div className="App">
            <Navigation />
            <motion.main
              className="main-content"
              initial="initial"
              animate="animate"
              exit="exit"
              variants={pageVariants}
            >
              <Routes>
                {/* Public Routes */}
                <Route path="/" element={<LandingPage />} />
                <Route path="/login" element={<Login />} />
                <Route path="/register" element={<Register />} />

                {/* Patient Routes */}
                <Route path="/patient/dashboard" element={
                  <PrivateRoute role="patient">
                    <PatientDashboard />
                  </PrivateRoute>
                } />
                <Route path="/patient/schedule" element={
                  <PrivateRoute role="patient">
                    <PatientSchedule />
                  </PrivateRoute>
                } />
                <Route path="/patient/profile" element={
                  <PrivateRoute role="patient">
                    <PatientProfile />
                  </PrivateRoute>
                } />

                {/* Practitioner Routes */}
                <Route path="/practitioner/dashboard" element={
                  <PrivateRoute role="practitioner">
                    <PractitionerDashboard />
                  </PrivateRoute>
                } />
                <Route path="/practitioner/schedule" element={
                  <PrivateRoute role="practitioner">
                    <PractitionerSchedule />
                  </PrivateRoute>
                } />
                <Route path="/practitioner/patients" element={
                  <PrivateRoute role="practitioner">
                    <PractitionerPatients />
                  </PrivateRoute>
                } />

                {/* Shared Routes */}
                <Route path="/booking" element={
                  <PrivateRoute>
                    <BookingSystem />
                  </PrivateRoute>
                } />
                <Route path="/notifications" element={
                  <PrivateRoute>
                    <NotificationCenter />
                  </PrivateRoute>
                } />
              </Routes>
            </motion.main>
          </div>
        </Router>
      </NotificationProvider>
    </AuthProvider>
  );
}

export default App;
